Those matcher are exclusive to stubr and not available in Wiremock. They allow crafting more relaxed request matchers when it comes to authorization. You could for example have stubs specialized for a specific user (we sometimes persona). You can have matchers for Basic authentication ( RFC 7617 ). For example, for matching Authorization: Basic am9obi5kb2U6Y2hhbmdlbWU= you would have: { "request": { "basicAuth": { "username": "john.doe", "password": "changeme" } }
} You can also match a JWT token in the Authorization header as per RFC 7519 { "request": { "jwtAuth": { "equalTo": "eyJhbGciOiJSUzI1NiJ9.e30.MBkQ...", "alg": { "equalTo": "RS256", "oneOf": [ "RS256", "HS256" ] }, "payloadPatterns": [ { "equalToJson": { "iss": "john.doe" } }, { "equalToJson": { "exp": 1300819380 } }, { "expression": "$.address", "equalToJson": { "street": "rue de Rivoli", "city": "Paris" } } ] } }
} equalTo by equality matcher. Equivalent to "headers":{"authorization":{"equalTo": "..."}}. If you have this matcher, all the other ones will be ignored alg.equalTo by equality matcher. JWT algorithm has to be exactly this alg.oneOf JWT algorithm has to be one of the supplied values. Here are all the supported JWT algorithms [HS256, HS384, HS512, ES256, ES384, RS256, RS384, RS512, PS256, PS384, PS512, EdDSA] payloadPatterns for matching the JWT body. Exactly the same matcher as body ones.

