Another kind of relaxing you can do is by being able to represent as best as possible the actual http response of your app. Very often, a field in the response is the exact same as the one in the request e.g. in a POST request to create a REST resource. You can use in your response parts of the request to do so. { "response": { "transformers": [ "response-template" ], "jsonBody": { "url-path-and-query": "{{request.url}}", "url-path": "{{request.path}}", "url-path-segments": "{{request.pathSegments.[1]}}", "query": "{{request.query.kind}}", "multi-query": "{{request.query.kind.[1]}}", "method": "{{request.method}}", "header": "{{request.headers.Content-Type}}", "multi-header": "{{request.headers.cache-control.[0]}}", "body": "{{request.body}}", "from-request": "{{jsonPath request.body '$.name'}}" } }
} request.url given a request to http://localhost/api/path?a=b returns path?a=b request.path given a request to http://localhost/api/path?a=b returns api/path request.pathSegments.[i] allows picking a part of the url path (i is zero indexed) e.g. http://localhost/a/b/c with i == 1 returns b query.<selector>.[i] allows picking a named query parameter. Replace <selector> by the name of the query parameter. If the query parameter is multivalued, you can select only one with the zero indexed i. For example with http://localhost?a=1&a=2&a=3&b=1 then {{query.b}} returns 1 and {{query.a.[1]}} returns 2 request.method returns the (uppercase) http request method. If you want the lowercase method just {{lower request.method}} request.headers.<selector>.[i] about the same as picking query parameters. Note that here selector is case-insensitive. request.body takes the raw request body without altering it jsonPath request.body '<json-path>' for templating only a field from request's json body. json-path is the JSONPath for selecting the right field. Use an online JSONPath evaluator to try out your paths. You also sometimes have to generate dynamic data or to transform existing one: { "response": { "transformers": [ "response-template" ], "jsonBody": { "now": "{{now}}", "now-fmt": "{{now format='yyyy/MM/dd'}}", "now-fmt-epoch": "{{now format='epoch'}}", "now-fmt-unix": "{{now format='unix'}}", "now-positive-offset": "{{now offset='3 days'}}", "now-negative-offset": "{{now offset='-3 days'}}", "now-with-timezone": "{{now timezone='Europe/Rome'}}", "number-is-odd": "{{isOdd request.body}}", "number-stripes": "{{stripes request.body 'if-even' 'if-odd'}}", "string-capitalized": "{{capitalize request.body}}", "string-uppercase": "{{upper request.body}}", "string-trim": "{{trim request.body}}", "size": "{{size request.body}}", "base64-encode": "{{base64 request.body padding=false}}", "base64-decode": "{{base64 request.body decode=true}}", "url-encode": "{{urlEncode request.header.x-raw}}", "url-decode": "{{urlEncode request.header.x-encoded decode=true}}" } }
} now by default return the current datetime in RFC 3339 format (this is only for backward compatibility with Wiremock) format could be either: a custom Java SimpleDateFormat (for Wiremock compatibility) e.g. format='yyyy/MM/dd' epoch Unix timestamp in milliseconds unix Unix timestamp in seconds offset now with the given offset expressed in human-readable format. Refer to humantime documentation for further examples. timezone for using a string timezone (see list ) isOdd or isEven returns a boolean whether the numeric value is an even or odd integer capitalize first letter to uppercase e.g. mister becomes Mister upper or lower recapitalizes the whole word stripes returns alternate values depending if the tested value is even or odd trim removes leading & trailing whitespaces size returns the number of bytes for a string (⚠️ not the number of characters) or the size of an array base64 for standard (no base64 url encoding yet) Base64 encoding decode for decoding when true padding with/without padding urlEncode for url encoding the value. Use decode=true to decode
